design-patterns/abstract-factory.html.body:
Abstract Factory Pattern
Code Example
class AbstractFactory(object):
    def create_product(self, *args):
        raise NotImplementedError()


class ConcreteFactory(AbstractFactory):
    def create_product(self, *args):
        return Product()


class Product(object):
    @staticmethod
    def do_something():
        print('This is product.')


class Client(object):
    def __init__(self, factory: AbstractFactory):
        self.factory = factory

    def get_product(self):
        product = self.factory.create_product()
        product.do_something()

if __name__ == '__main__':
    factory = ConcreteFactory()
    client = Client(factory)
    client.get_product()  # This is product.

Related Patterns

AbstractFactory는 Factory 나 Prototype 으로 구현
ConcreteFactory는 Singleton 으로 구현

design-patterns/adapter.html.body:
Adapter Pattern
What is this?

어댑터 패턴은 클래스마다 다른 인터페이스를 제공할 때 사용한다. 실제로 사용되는 케이블 어댑터가 각각의 휴대폰을 충전하는 것을 생각해보면 이해하기 쉽다. 서로 맞지 않는 인터페이스 때문에 통합 하기 힘든 클래스를 통합해야 할 때 어댑터 패턴을 적용할 수 있다.

Code Example
class Dog(object):

    def __init__(self):
        self.name = "Dog"

    def bark(self):
        return "woof!"


class Cat(object):

    def __init__(self):
        self.name = "Cat"

    def meow(self):
        return "meow!"


class Human(object):

    def __init__(self):
        self.name = "Human"

    def speak(self):
        return "'hello'"


class Car(object):

    def __init__(self):
        self.name = "Car"

    def make_noise(self, octane_level):
        return "vroom{0}".format("!" * octane_level)


class Adapter(object):

    def __init__(self, obj, **adapted_methods):
        """We set the adapted methods in the object's dict"""
        self.obj = obj
        self.__dict__.update(adapted_methods)

    def __getattr__(self, attr):
        """All non-adapted calls are passed to the object"""
        return getattr(self.obj, attr)

    def original_dict(self):
        """Print original object dict"""
        return self.obj.__dict__


def main():
    objects = []
    dog = Dog()
    print(dog.__dict__)
    objects.append(Adapter(dog, make_noise=dog.bark))
    print(objects[0].__dict__)
    print(objects[0].original_dict())
